from typing import *
from time import time

class Solution:
    def findMaxLength(self, nums: List[int]) -> int:
        countArray = [0] 
        for v in nums:
            countArray.append(countArray[-1] + (1 if v == 1 else -1))
        maxArrayLen = 0 
        prevSeen = dict()
        for index, val  in enumerate(countArray):
            if val in prevSeen.keys():
                maxArrayLen = max(maxArrayLen, index - prevSeen[val])
            else : 
                prevSeen[val] = index

        return maxArrayLen

